import React, { Component } from 'react';
import {Link} from "react-router-dom";
import "../App.css";

export default class RandomPic extends Component {
    state = {
        picinfo : null 
    }
    componentDidMount(){
        let {slug} = this.props.match.params || "";
       fetch(`https://dog.ceo/api/breed/${slug}/images/random`).then
       (res=>res.json()).then(({message})=>{
           console.log(message)
           this.setState({picinfo : message});
       })
    }
    render() {
        console.log(this.state.picinfo)
        return (
            <div>

                <div className="container">
                    <div className="notification">
                        <div className="image-container">
                            <img src={this.state.picinfo} alt="pic"/>
                        </div>
                        <Link to="/breedlist" class="button">Back</Link>
                        <Link to="/signin" class="button">Logout</Link>
                    </div>
                </div>

            </div>
        )
    }
}
